    def parse_list_page(self, response):
        details = response.xpath('//tr[@class="RowPrintBorder"]')
        for detail in details:
            business_name = detail.xpath('./td/strong/text()').extract_first('').strip()
            street_address = detail.xpath('.//th[contains(text(),"Full Address")]/following-sibling::td[2]/text()[1]').extract_first('').strip()
            city_state = detail.xpath('./td[2]/text()[3]').extract_first('').strip()
            city = city_state.split(', ')[0]
            state = city_state.split(', ')[1].split(' ')[0] 
            postal_code = city_state.split(', ')[1].split(' ')[1]
            phone = detail.xpath('.//div[contains(@id, "detailDiv")]/../following-sibling::td[1]/text()').extract_first('').strip()
            license_number = detail.xpath('.//th[contains(text(),"License No")]/following-sibling::td[2]/text()').extract_first('').strip()
            license_issue_date = detail.xpath('.//th[contains(text(),"Renewal Date")]/following-sibling::td[2]/text()').extract_first('').strip()
            l = CompanyLoader(item=UpwardMobilityItem(), response=response)
            l.add_value('source', 'Federal Maritime Commission')
            l.add_value('company_url', response.url)
            l.add_value('business_name', business_name)
            l.add_value('street_address', street_address)
            l.add_value('city', city)
            l.add_value('state', state)
            l.add_value('postal_code', postal_code)
            l.add_value('country', 'USA')
            l.add_value('phone', phone)
            l.add_value('license_number', license_number)
            l.add_value('license_issue_date', license_issue_date)
            yield l.load_item()

